import React, { useState } from 'react';
import { Outlet, NavLink, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { FiHome, FiList, FiUsers, FiShare2, FiCheckSquare, FiLogOut, FiMenu, FiX } from 'react-icons/fi';

const DashboardLayout = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  // Nav links configuration
  const navLinks = [
    { to: '/', label: 'Dashboard', icon: <FiHome className="mr-2" /> },
    { to: '/listings', label: 'Listings', icon: <FiList className="mr-2" /> },
    { to: '/leads', label: 'Leads', icon: <FiUsers className="mr-2" /> },
    { to: '/social', label: 'Social', icon: <FiShare2 className="mr-2" /> },
    { to: '/tasks', label: 'Tasks', icon: <FiCheckSquare className="mr-2" /> },
  ];

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-gradient-to-r from-blue-600 to-blue-800 text-white shadow-lg">
        <div className="container mx-auto px-4 py-4">
          <div className="flex justify-between items-center">
            <div className="flex items-center">
              <h1 className="text-xl md:text-2xl font-bold">Real Estate Agent Dashboard</h1>
            </div>

            {/* Mobile menu button */}
            <div className="block md:hidden">
              <button 
                onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
                className="text-white focus:outline-none"
              >
                {isMobileMenuOpen ? <FiX size={24} /> : <FiMenu size={24} />}
              </button>
            </div>

            {/* Desktop user menu */}
            <div className="hidden md:flex items-center space-x-4">
              <div className="flex items-center">
                <div className="text-sm mr-2">
                  <div className="font-medium">{user?.name || 'User'}</div>
                  <div className="text-blue-200 text-xs">{user?.role || 'Agent'}</div>
                </div>
                <div className="bg-blue-700 p-2 rounded-full">
                  <span className="text-xl font-bold">
                    {user?.name ? user.name.charAt(0).toUpperCase() : 'U'}
                  </span>
                </div>
              </div>
              <button 
                onClick={handleLogout} 
                className="flex items-center text-sm bg-blue-700 hover:bg-blue-600 px-3 py-2 rounded"
              >
                <FiLogOut className="mr-1" /> Logout
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Mobile menu */}
      {isMobileMenuOpen && (
        <div className="md:hidden bg-white shadow-lg">
          <div className="px-2 pt-2 pb-3 space-y-1">
            {navLinks.map((link) => (
              <NavLink
                key={link.to}
                to={link.to}
                className={({ isActive }) => 
                  `flex items-center px-3 py-2 rounded-md text-base font-medium ${
                    isActive 
                      ? 'bg-blue-100 text-blue-700' 
                      : 'text-gray-700 hover:bg-gray-100'
                  }`
                }
                onClick={() => setIsMobileMenuOpen(false)}
              >
                {link.icon} {link.label}
              </NavLink>
            ))}
            <button 
              onClick={handleLogout} 
              className="flex items-center w-full px-3 py-2 text-base font-medium text-gray-700 hover:bg-gray-100 rounded-md"
            >
              <FiLogOut className="mr-2" /> Logout
            </button>
          </div>
        </div>
      )}

      {/* Navigation */}
      <nav className="bg-white shadow-sm hidden md:block">
        <div className="container mx-auto px-4">
          <div className="flex space-x-8">
            {navLinks.map((link) => (
              <NavLink
                key={link.to}
                to={link.to}
                className={({ isActive }) => 
                  `flex items-center py-4 px-2 font-medium border-b-2 ${
                    isActive 
                      ? 'text-blue-600 border-blue-600' 
                      : 'text-gray-500 border-transparent hover:text-blue-500'
                  }`
                }
              >
                {link.label}
              </NavLink>
            ))}
          </div>
        </div>
      </nav>

      {/* Main Content */}
      <main className="container mx-auto px-4 py-8">
        <Outlet />
      </main>
    </div>
  );
};

export default DashboardLayout;
